import React from "react";
import "./index.css";
import Naat from "./Naat";
import Ndata from "./Ndata";

function ncard(val) {
  return (
    <Naat
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
}

const favnat = "wo mera nabi hai";

const FavNaat = () => {
  if (favnat === "wo mera nabi hai") {
    return (
      <Naat
        key={Ncard[4].key}
        pic={ncard[4].pic}
        cat={ncard[4].cat}
        tit={ncard[4].tit}
        link={ncard[4].link}
        dlink={ncard[4].dlink}
      />
    );
  }
};

function App() {
  return (
    <>
      <h4 className="heading_style">5 Good Naats </h4>
      {FavNaat}
    </>
  );
}

export default App;
